import ExpenseItem from "./ExpenseItem";

export function ExpenseList(props) {
  {
    props.filteredItems.length === 0 ? (
      <p>No expenses found.</p>
    ) : (
      props.filteredItems.map((expense) => (
        <ExpenseItem
          key={expense.key}
          title={expense.title}
          amount={expense.amount}
          date={expense.date}
        />
      ))
    );
  }
}
